import React from 'react'

function AddCompany() {
    const [age, setAge] = useState();

    const handleChange = (e) => {
        const value = e.target.value.replace(/\D/g, "");
        setAge(value);
    };

    return (
        <div>
            <input value={age} onChange={handleChange}/>
        </div>
    );

}
    export default AddCompany;
